    constructor(props) {
        super(props);
    }
    componentDidMount()
    {
        this.props.Actions()
    }
    render() {
        return (
            <div>
                {
                    this.props.workers.map((res,index) => {
                        return (<ul>
                            <li>{res.id}</li>
                            <li>{res.id}</li>
                            <li>{res.id}</li>
                            
                        </ul>)
                    }
                    
                    )
                }
            </div>
        );
    }
}
